/*
  The remaining 0.5% of supply goes to voted pools,
  but this only gets to the full 0.5% as the amount of ve used
  for voting reaches a value of $1M (from 1 to 1 price of yMeta)

  Allow pro-rated withdraw

  So if 1/10 of $1M, can withdraw 1/10
*/

contract VotersRewardsFormula{
  using SafeMath for uint;

  address public usdPool;
  address public usdToken;
  address public rewardsLocker;
  address public rewardToken;

  // 1.000.000 usd
  uint public usdGoal = 1000000000000000000000000;

  constructor(
    address _usdPool,
    address _usdToken,
    address _rewardsLocker,
    address _rewardToken
    )
    public
  {
    usdPool = _usdPool;
    usdToken = _usdToken;
    rewardsLocker = _rewardsLocker;
    rewardToken = _rewardToken;
  }

  function computeRewards() public view returns(uint) {
    uint currentUsd = IERC20(usdToken).balanceOf(usdPool);
    uint currentRewards = IERC20(rewardToken).balanceOf(rewardsLocker);

    if(currentUsd >= usdGoal){
      return currentRewards;
    }
    else if (currentUsd == 0){
      return 0;
    }
    else{
      return currentRewards.div(usdGoal / 10**18).mul(currentUsd / 10**18);
    }
  }
}

